CREATE TABLE [dbo].[tickets] (
  [_id] int  IDENTITY(1,1) NOT NULL,
  [adminId] varchar(50) COLLATE SQL_Latin1_General_CP1_CI_AS  NOT NULL,
  [accountId] bigint  NOT NULL,
  [state] bit  NOT NULL,
  [description] int  NOT NULL,
  [support_files] image  NULL,
  [date] datetime DEFAULT (getdate()) NOT NULL,
  [conversation] text COLLATE SQL_Latin1_General_CP1_CI_AS  NOT NULL,
  [AdminName] varchar(50) COLLATE SQL_Latin1_General_CP1_CI_AS DEFAULT ('GM') NOT NULL
)
GO

